import React from 'react';
import './NavBar.css';

function NavBar() {
  return (
    <div className="search-form">
    	<nav className="navbar navbar-dark bg-color">
  			<a className="navbar-brand logo" href="../index.js">FindMovies</a>
		</nav>
    </div>
  );
}

export default NavBar;
